import React from 'react'
import  ReactDOM  from 'react-dom'
import Match from "./Matches"
import Data from "./Data"
import "./index.css"

ReactDOM.render(
  <>
  <Match
  round={Data[0].round}
  img1={Data[0].img1}
  result={Data[0].result}
  img2={Data[0].img2}
  name1={Data[0].name1}
  trophy={Data[0].trophy}
  name2={Data[0].name2}

  />
  </>,document.getElementById("root"))
